import React from "react";

import { Bar } from "react-chartjs-2";

const BarChartGender = () => {
    const [data, setData] = React.useState({});
    
    const chart = () => {
        let vaccinated = [];
        let unvaccinated = [];
        let age = [];
        fetch("http://localhost:3001/results")
        .then((res) => res.json())
        .then((res) => {
            // console.log(res);
            for (const dataObj of res) {
                console.log()
            vaccinated.push(parseInt(dataObj.count));
            age.push(parseInt(dataObj.age));
            }
            setData({
            labels: age,
            datasets: [
                {
                label: "Vaccinated",
                data: vaccinated,
                backgroundColor: ["rgba(255, 99, 132, 0.6)"],
                borderWidth: 4,
                },
                {
                label: "Unvaccinated",
                data: unvaccinated,
                backgroundColor: ["rgba(54, 162, 235, 0.6)"],
                borderWidth: 4,
                },
            ],
            });
        });
    };
    
    React.useEffect(() => {
        chart();
    }, []);
    return (
        <div>
        <Bar
            data={data}
            options={{
            responsive: true,
            title: { text: "THICCNESS SCALE", display: true },
            scales: {
                yAxes: [
                {
                    ticks: {
                    autoSkip: true,
                    maxTicksLimit: 10,
                    beginAtZero: true,
                    },
                    gridLines: {
                    display: false,
                    },
                },
                ],
                xAxes: [
                {
                    gridLines: {
                    display: false,
                    },
                },
                ],
            },
            }}
        />
        </div>
    );
    };

export default BarChartGender;
